  const [admin, setadmin] = useState(false);

  useEffect(() => {
    const config = {
      headers: {
        Authorization: `Bearer ${token}`,
      },
    };

    axios.get("/annonce/admin",config)
    .then((res)=>{
      if(res.data === 'admin'){
        setadmin(true);
